import React from 'react';
import logo from './logo.svg';
import './App.css';
import { TextField } from '@material-ui/core'

function App() {
  return (
    <div className="App" style={{ height:'1000px', width: '100%', backgroundColor: 'gray'}}>

      <div style={{margin: 'auto', marginBottom: '50vh', marginTop: '50vh'}}>
        <TextField 
          style={{ color: 'white' }} 
          id="filled-basic" 
          label="text" 
          multiline
          rows={4}
          />

      </div>
    </div>
  );
}

export default App;
